import React from 'react';
import Carousel from './Carousel';
import CartPage from './CartPage';
import Products from './Products';

const Main = () => {
  return (
    <main>
      <Carousel></Carousel>
      <Products></Products>
      <CartPage></CartPage>
    </main>
  );
};

export default Main;
